INSERT INTO `tbl_profile` (`id_profile`, `judul`, `ket`, `tgl_profile`) VALUES
(1, 'Visi &amp; Misi', '<p>\r\n\r\n</p><p><b>VISI</b></p><p><i><b>“Terwujudnya Kabupaten Serang Yang &nbsp;Semakin Maju, Sejahtera, Berkeadilan Dan Agamis”</b></i></p><p>Penjabaran makna dari Visi Kabupaten &nbsp;Serang &nbsp;yaitu:</p><p><b></b></p><b>1. MAJU</b><p></p><p></p><p></p>Pembangunan dilakukan di segala sektor untuk meningkatkan pelayanan dasar dan perekonomian masyarakat yang didukung dengan pembenahan infrastruktur di seluruh wilayah Kabupaten Serang.<p></p><p><b></b></p><b>2.&nbsp;SEJAHTERA</b><b></b><p></p><p></p>Perwujudan terpenuhinya kebutuhan lahiriah (pangan, sandang, papan, kesehatan dan pendidikan) dan kebutuhan batiniah (agama dan budaya) masyarakat Kabupaten Serang. Kesejahteraan dalam artinya yang sejati adalah keseimbangan hidup yang merupakan buah dari kemampuan seseorang untuk memenuhi kebutuhan dasar seluruh dimensi dirinya, meliputi ruhani, akal, dan jasad. Kesejahteraan yang seperti inilah yang akan membentuk kepecayaan diri yang tinggi pada masyarakat Kabupaten Serang untuk mencapai kualitas kehidupan yang semakin baik.<p></p><p><b></b></p><b>3. BERKEADILAN</b><p></p><p></p>Pembangunan di Kabupaten Serang dilakukan secara merata dengan memperhatikan aspek kewilayahan dan mempertimbangkan aspek sosial-ekonomi masyarakat untuk mewujudkan pembangunan yang berkelanjutan.<p></p><p><b></b></p><b>4. AGAMIS</b><p></p><p></p><p></p><p></p><p>Perwujudan implementasi norma agama dan nilai budaya sebagai landasan moral dan spiritual dalam seluruh aspek kehidupan bermasyarakat dalam rangka penyelenggaraan pembangunan yang dilaksanakan oleh seluruh masyarakat Kabupaten Serang yang memiliki keutamaan untuk selalu melaksanakan dan mencegah kemungkaran sehingga terbentuk karakter dan jati diri masyarakat yang mulia dan berbudaya .</p>\r\n\r\n<p></p><p></p><p></p><b><br>Misi</b>\r\n\r\n<p>Perhatikan visi serta perubahan paradigma dan kondisi yang akan dihadapi pada masa yang akan datang, maka dalam upaya mewujudkan Visi pembangunan Kabupaten Serang Tahun 2021-2026, Misi pembangunan sebagai berikut:</p><ol><li>meningkatkan dan pemerataan kesempatan memperoleh pendidikan dan layanan pendidikan yang berkualitas disetiap jalur dan jenjang pendidikan serta mengembangkan tradisi budaya sebagai kearifan lokal yang tumbuh dan hidup ditengah masyarakat</li><li>peningkatan pelayanan kesehatan yang bermutu, merata dan terjangkau yang didukung oleh tenaga kesehatan yang profesional</li><li>peningkatan pembangunan prasarana wilayah, Penataan Ruang Dan Permukiman yang memadai dan berkualitas.</li><li>kemandirian dan daya saing ekonomi masyarakat, untuk optimalisasi penyerapan tenaga kerja dan penanggulangan kemiskinan.</li><li>peningkatan Tata Kelola Pemerintahan Yang Baik Serta Pelayanan Publik Yang Prima Didukung Kapasitas Birokrasi Yang Berintegritas, Kompeten Dan Profesional</li><li>Memantapkan Fungsi Dan Peran Agama Sebagai Landasan Moral Dan Spiritual Dalam Kehidupan Individu, Bermasyarakat Dan Bernegara .</li></ol>\r\n\r\n<br><p></p><p></p>', '2022-05-25 21:12:46'),
(2, 'Tugas', '<p>\r\n\r\n</p><h3><b>Tugas Pokok</b></h3><h5>Bappeda memiliki tugas yaitu &nbsp;melaksanakan penyusunan dan pelaksanaan kebijakan bidang perencanaan pembangunan daerah&nbsp;</h5><p>\r\n\r\n</p><h3>\r\n\r\n</h3><h3><b>Fungsi</b></h3><h5>\r\n\r\nBadan Perencanaan Pembangunan Daerah dalam melaksanakan&nbsp; sebagaimana dimaksud pada ayat (1) menyelenggarakan fungsi dan\r\nkewenangan :</h5><h5><ol><li>&nbsp;Penyusunan kebijakan teknis di bidang Perencanaan, Penelitian dan\r\nPengembangan</li><li>&nbsp;Pelaksanaan tugas dukungan teknis di bidang Perencanaan,\r\nPenelitian dan Pengembangan</li><li>Pemantauan, evaluasi dan pelaporan pelaksanaan tugas dukungan\r\nteknis di bidang Perencanaan, Penelitian dan Pengembangan&nbsp;</li><li>Pembinaan teknis penyelenggaraan fungsi penunjang Urusan\r\nPerencanaan</li><li>Penelitian dan Pengembangan\r\n\r\nPelaksanaan fungsi lain yang diberikan oleh gubernur terkait dengan\r\ntugas dan fungsinya.\r\n\r\n</li></ol></h5><p><br></p>\r\n\r\n<br>\r\n\r\n<br><p></p>\r\n\r\n<p></p>', '2022-05-29 15:29:49');
