(13, 14, '<p>Sangat Baik = 90<br></p><p>Baik&nbsp; &nbsp; &nbsp; = 80</p><p>Cukup&nbsp; = 70</p><p>Kurang = 60</p><p>Sangat Kurang = 50</p>', '2022-08-13 14:04:04'),
(2, 2, '<p><b>IPK</b>&nbsp;&nbsp;</p><p>3.85 - 4.00&nbsp; = 90</p><p>3.70 - 3.84&nbsp; = 80</p><p>3.40&nbsp; - 3.69&nbsp; = 70</p><p>3.00&nbsp; -&nbsp; 3.39 = 60</p><p>2.50&nbsp; -&nbsp; 2.95 = 50</p><p></p><p><b>Nilai</b></p><p>90 - 95&nbsp; &nbsp;=&nbsp; 90</p><p>85 - 89&nbsp; &nbsp;=&nbsp; 80</p><p>80 - 84&nbsp; &nbsp;=&nbsp; 70</p><p></p><p>70 - 79&nbsp; &nbsp;= 60</p><p>50 - 69&nbsp; &nbsp;= 50\r\n\r\n<br></p>', '2020-06-10 14:56:55'),
(3, 3, '<p>\r\n\r\n</p><p>\r\n\r\n5 TAHUN = 100\r\n\r\n<br></p><p>\r\n\r\n4 TAHUN = 90\r\n\r\n<br></p><p>\r\n\r\n3 TAHUN = 85\r\n\r\n<br></p><p>\r\n\r\n2 TAHUN  = 80\r\n\r\n<br></p><p>\r\n\r\n1 TAHUN  = 70\r\n\r\n<br></p><p><br></p><p><br></p><p>&nbsp;</p><p><br></p><p><br></p><p><br></p>\r\n\r\n<p></p>', '2020-06-10 14:56:55'),
(4, 4, '<p>&lt;20&nbsp; &nbsp; &nbsp;= 60</p><p>20- 25 = 85&nbsp;<br></p><p>\r\n\r\n26- 30 = 80 \r\n\r\n<br></p><p>31- 40 = 70 \r\n\r\n<br></p><p>&gt;40&nbsp; &nbsp; &nbsp;=&nbsp; 50</p>', '2020-06-10 14:56:55'),
(5, 5, '<p>Sehat ( Tidak Buta Warna )&nbsp; = 80</p><p>Tidak Sehat (Buta Warna )&nbsp; &nbsp;= 50</p>', '2020-06-10 14:56:55'),
(11, 6, '<p>Belum menikah = 80\r\n\r\n<br></p><p>Menikah&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;= 60</p><p><br></p>', '2020-06-10 14:56:55');
